import React from 'react';

const middleStyle = {
    fontSize: "48px",
    paddingLeft: 420,
    backgroundColor: '#4a1900',
    minHeight: '410px',
}

export default function Middle() {
    return (
        <div style={middleStyle}>dffd</div>
    );
}
